    false,nt"url": null,nt"notes": "The U.S. Geological Survey St. Petersburg
    Coastal and Marine Science Center (USGS-SPCMSC) and the U.S. Army Corps of Engineers
    Field Research Facility (USACE-FRF) of Duck, NC collaborated to gather alongshore
    ground-based lidar beach topography at Fire Island, NY. This high-resolution elevation
    dataset was collected on April 1, 2014, and is part of the USGS's ongoing beach
    monitoring effort under Hurricane Sandy Supplemental Project GS2-2B. This USGS Data
    Release includes the resulting processed elevation point data (xyz) and an interpolated
    digital elevation model (DEM).",nt"license_title": null,nt"extras": [{ntt"key":
